import React from 'react';
import TaskItem from './TaskItem';

/**
 * Liste des tâches affichées en fonction du filtre appliqué.
 * @param {Array} tasks - Liste des tâches à afficher.
 * @param {function} updateTask - Fonction pour mettre à jour une tâche.
 * @param {function} deleteTask - Fonction pour supprimer une tâche.
 * @param {function} toggleComplete - Fonction pour basculer le statut de complétion d'une tâche.
 */
function TaskList({ tasks, updateTask, deleteTask, toggleComplete }) {
  return (
    <div className="task-list">
      {tasks.map(task => (
        <TaskItem 
          key={task.id} 
          task={task} 
          updateTask={updateTask} 
          deleteTask={deleteTask} 
          toggleComplete={toggleComplete} 
        />
      ))}
    </div>
  );
}

export default TaskList;
